window.bookSummaryJSON = "Take an exit off the Jersey Turnpike to the irresistible world of Stephanie Plum, America's favorite bounty hunter, where she gets into more trouble than ever. This time, she faces a notorious gang in Trenton who wants her dead. Morelli warns that she's in too deep, and Stephanie more than agrees. But the gang won't let her bow out. With Ranger missing in action, Stephanie has to go into hiding, and stumbles on to the secret location of Ranger's \"bat cave\". Is it the perfect place to disappear? Or will she get into more trouble than she knows by delving into his private world? The tenth Stephanie Plum novel is filled with Evanovich's trademark high stakes, high adventure, high wit, and sly comedy."; 
